import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter,Route,Routes } from 'react-router-dom';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route exact path="/" element={<h1>Products Component</h1>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
